import ReactDOM from 'react-dom';
import React from 'react';

// Elements show up in the Canvas elements menu and can be visually added to a canvas
const elements = [
  () => ({
    name: 'canvasAction',
    displayName: 'Canvas action',
    help: 'Call a third party API from Canvas',
    image: 'data:image/png;base64,',
    expression: 'canvasAction name="jsonplaceholder" api="https://jsonplaceholder.typicode.com/posts/1/comments" label="Get comments"',
  }),
];

// Browser functions are Canvas functions which run in the browser, and can be used in
const browserFunctions = [
  () => ({
    name: 'canvasAction',
    help: 'Call a third party API from Canvas',
    args: {
      name: {
        types: ['string'],
        default: 'apiName',
      },
      api: {
        types: ['string'],
        default: 'https://jsonplaceholder.typicode.com/todos/3',
      },
      label: {
        types: ['string'],
        default: 'Eject my seat',
      },
    },
    fn: (context, args) => {
      return {
        type: 'render',
        as: 'canvasAction',
        value: {
          name: args.name,
          api: args.api,
          label: args.label,
        },
      };
    },
  }),
];

const renderers = [
  () => ({
    name: 'canvasAction',
    displayName: 'Canvas Action',
    help: 'Call a third party API from Canvas',
    reuseDomNode: true,
    render(domNode, config, handlers) {
      const callApi = () => {
        return (async () => {
            const response = await fetch(config.api);
            const body = await response.json();
    
            if (response.status !== 200) throw Error(body.message);
            return body.libraries;
        })();
      }

      const random = (
        <a id={config.name} onClick={callApi}>{config.label}</a>
      )

      ReactDOM.render(random, domNode, () => {
        handlers.done();
      });

      handlers.onDestroy(() => {
        ReactDOM.unmountComponentAtNode(domNode);
      });

      handlers.onResize(() => {
      });

      return handlers.done();

    }
  }),
]

// Register our elements and browserFunctions with the Canvas interpreter.
kbnInterpreter.register({
  elements,
  browserFunctions,
  renderers,
});